import React from 'react';

const unauthenticatedPosts = async() => {
const response = await fetch("https://strangers-things.herokuapp.com/api/2110-VPI-WEB-PT/posts")
    .then(response => response.json())
    .then(result => {
      console.log(result);
    })
    .catch(console.error);

    return (
      <div>

      </div>
    )
}

const authenticatedPosts = async() => {
  const response = await fetch("https://strangers-things.herokuapp.com/api/2110-VPI-WEB-PT/posts", {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      'Authorization': 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2MWYzNWRjNWMxYTgyZDAwMTc3YTg0OTEiLCJ1c2VybmFtZSI6Ikphc29uIiwiaWF0IjoxNjQzMzM5MjA1fQ.bB63o6KaEkdrxNE_zu-0rWiWEudhwtd-qCOPJUoz2tA'
    },
    body: JSON.stringigy ({})
  })
}

const Posts = () => {
  return (
    <>
      {
        userToken ? <authenticatedPosts /> : <unauthenticatedPosts />
      }
    </>
  )

 
}


export default Posts;
